function check_parentheses(s) {
    var stack = [];
    var parentheses = new Set(['()', '[]', '{}']);
    for (var ch of s) {
        if ('([{'.indexOf(ch) >= 0) {
            stack.push(ch);
        }
        else if (stack.length == 0 || !parentheses.has(stack.pop() + ch)) {
            return false;
        }
    }
    return stack.length == 0;
}
